import React from "react";
import { Col, Row } from "react-bootstrap";

const CartItems=(props)=>{

    return(
        <li>
            <p style={{fontFamily: "cursive", textAlign: "center"}}>Cart</p>
            <Row xs={3}>
                <Col>Title</Col>
                <Col>Proce</Col>
                <Col>Quantity</Col>
            </Row>
        </li>
    )
}

export default CartItems
